import React from 'react';
import { createGlobalStyle } from 'styled-components';
import DetailPage from './Pages/DetailPage';

const GlobalStyle = createGlobalStyle`
  body{
    background: #FFF;
    }
`;

const App = () => {
  return (
    <Routes>
      <Route path = "/" element={<DetailPage />} />
      <GlobalStyle />
      <Bars></Bars>
    </Routes>
  );
}


export default App;
